import React from 'react';

interface FieldsetProps {
  legendText: string,
}

export const Fieldset: React.FC<FieldsetProps> = ({legendText, children}) => {
  return (
    <fieldset>
      <legend>{legendText}</legend>
      {children}
    </fieldset>
  );
};
